import React from 'react'

const ReadQr = () => {
  return (
    <div>
        <h2>Read QR Code</h2>
       <div className="createqr">
        <button type="button" className='btn5'>Scan QR Code</button>
        <input type="file" accept=".png, .jpg, .jpeg" style={{display:"none"}}/>
        <div className='image'>

        </div>
       
       </div>
    </div>
  )
}

export default ReadQr;
